ONTENDRÁ LOS AMINOÁCIDOS ESENCIALES **. LÍPIDOS Y ÁCIDOS GRASOS. GRASAS MÍNIMO/100 KCAL 4,4 G, MÁXIMO/100 KCAL 6 G NSR/100 KCAL -; ARA MÍNIMO/100 KCAL 7 MG, MÁXIMO/100 KCAL S.E. NSR/100 KCAL -; DHA MÍNIMO/100 KCAL 7 MG, MÁXIMO/100 KCAL S.E. NSR/100 KCAL (0,5 % DE LOS ÁCIDOS GRASOS); RELACIÓN  ARA: DHA MÍNIMO/100 KCAL 1:1, MÁXIMO/100 KCAL 2:1 NSR/100 KCAL -; ÁCIDO LINOLEICO MÍNIMO/100 KCAL 300 MG, MÁXIMO/100 KCAL S. E. NSR/100 KCAL 1 400 MG; ÁCIDO ALFA-LINOLÉNICO MÍNIMO/100 KCAL 50 MG, MÁXIMO/100 KCAL S. E. NSR/100 KCAL -; HIDRATOS DE CARBONO. HIDRATOS DE CARBONO MÍNIMO/100 KCAL 9 G, MÁXIMO/100 KCAL 14 G NSR/100 KCAL -. DISPOSICIONES GENERALES. LA PROPORCIÓN DE ÁCIDO LINOLEICO/ALFA-LINOLÉNICO MÍNIMO 5:1, MÁXIMO 15:1 DE MANERA OPCIONAL, LA FUENTE DE PROTEÍNA PODRÁ CONTENER LOS AMINOÁCIDOS ESENCIALES (VALINA, LEUCINA, ISOLEUCINA, TREONINA, LISINA, METIONINA, FENILALANINA Y TRIPTÓFANO, Y OTROS, REGULADOS EN LA NORMA OFICIAL MEXICANA NOM-131-SSA1-2012) Y EN CASO DE SER ADICIONADOS SE LISTARÁN EN LA FICHA TÉCNICA. EL CONTENIDO DE ÁCIDOS GRASOS TRANS NO SERÁ SUPERIOR AL 3% DEL CONTENIDO TOTAL DE ÁCIDOS GRASOS EN LAS FÓRMULAS PARA LACTANTES. EN LAS FÓRMULAS PARA LACTANTES SÓLO PODRÁN AÑADIRSE ALMIDONES NATURALMENTE EXENTOS DE GLUTEN PRECOCIDOS Y/O GELATINIZADOS HASTA UN MÁXIMO DE 30% DEL CONTENIDO TOTAL DE HIDRATOS DE CARBONO Y HASTA UN MÁXIMO DE 2 G/100 ML. EN LAS FÓRMULAS PARA LACTANTES DEBE EVITARSE EL USO DE SACAROSA, ASÍ COMO LA ADICIÓN DE FRUCTOSA COMO INGREDIENTE, SALVO CUANDO SEA NECESARIO POR JUSTIFICACIÓN TECNOLÓGICA. EN LAS FÓRMULAS PARA LACTANTES PODRÁN AÑADIRSE OTROS NUTRIMENTOS/INGREDIENTES NORMALMENTE PRESENTES EN LA LECHE MATERNA O HUMANA EN CANTIDAD SUFICIENTE CON LA FINALIDAD DE LOGRAR EL EFECTO NUTRIMENTAL O FISIOLÓGICO DE ÉSTA, SOBRE LA BASE DE LAS CANTIDADES PRESENTES EN LA LECHE MATERNA Y PARA ASEGURARSE QUE SEA ADECUADO COMO FUENTE ÚNICA DE LA NUTRICIÓN DEL LACTANTE. SU IDONEIDAD E INOCUIDAD DEBE ESTAR DEMOSTRADA CIENTÍFICAMENTE. SE DEBE CONTAR CON EVIDENCIA CIENTÍFICA QUE DEMUESTRE LA UTILIDAD DE LOS NUTRIMENTOS/INGREDIENTES OPCIONALES QUE SE UTILICEN Y ESTAR A DISPOSICIÓN DE LA SECRETARÍA DE SALUD CUANDO ÉSTA LO SOLICITE. LAS FÓRMULAS QUE CONTENGAN MÁS DE 1,8 G DE PROTEÍNAS POR CADA 100 KCAL, DEBEN INCREMENTAR EL CONTENIDO DE PIRIDOXINA EN AL MENOS 15 µG DE PIRIDOXINA POR CADA GRAMO DE PROTEÍNA ARRIBA DE DICHO VALOR. EN LA FÓRMULA LISTA PARA SER CONSUMIDA DE ACUERDO CON LAS INSTRUCCIONES DESCRITAS EN LA ETIQUETA. SI SE AÑADE ÁCIDO DOCOSAHEXAENOICO (DHA), EL CONTENIDO DE ÁCIDO ARAQUIDÓNICO DEBE SER AL MENOS EL MISMO QUE EL DE DHA Y EL CONTENIDO DE ÁCIDO EICOSAPENTAENOICO (EPA) NO DEBE EXCEDER EL CONTENIDO DE DHA. ** OPCIONAL. S.E. SIN ESPECIFICACIÓN. NSR: NIVEL SUPERIOR DE REFERENCIA. ENVASE DESDE 360 G HASTA 454 G POLVO Y MEDIDA DOSIFICADORA.', ' ENVASE DESDE 360 G HASTA 454 G POLVO Y MEDIDA DOSIFICADORA', '41.5', '1', '2', '41.5', '83', '0', 'Compra Consolidada Bianual 2023-2024'),
